import Typography from '../atoms/Typography';

const Main = props => {
  return (
    <>
      <main {...props}>
        <div>
          <Typography variant={'h1'} children={'Hello'} />
        </div>
      </main>
      <style jsx>{`
        h1 {
          font-size: 30px;
        }
      `}</style>
    </>
  );
};

export default Main;
